import React from 'react';
class Userlist extends React.Component{
    render(){
        const mysql = require('mysql');
        const con = mysql.createConnection({
          host: "localhost",
          user: "root",
          password: "1234",
          database: 'testc'
        });

        con.connect(function(err) {
          if (err) throw err;
          con.query("SELECT * FROM ex_details", function (err, result, fields) {
            if (err) throw err;
            console.log(result);
          });
        });  
        return(
            <div>
                <table id="dtBasicExample" class="table table-striped table-bordered table-sm" cellspacing="0" width="100%">
                    <thead>
                        <tr>
                        <th class="th-sm">Name</th>
                        <th class="th-sm">Source Email</th>
                        <th class="th-sm">Destination Email</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <td>Tiger Nixon</td>
                        <td>System Architect</td>
                        <td>Edinburgh</td>
                        </tr>
                    </tbody>
                </table>
             </div>
        );
    }
}

export default Userlist;
